import React, { useEffect, useState } from "react";
import { useParams, Link } from "react-router-dom";
import { getMovieDetail } from "../api/omdb";

function MoviePage() {
  const { id } = useParams();
  const [movie, setMovie] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    const fetchMovie = async () => {
      try {
        setLoading(true);
        const data = await getMovieDetail(id);
        if (data.Response === "True") {
          setMovie(data);
        } else {
          setError(data.Error || "Movie not found");
        }
      } catch (error) {
        setError("Failed to fetch movie details");
      } finally {
        setLoading(false);
      }
    };

    fetchMovie();
  }, [id]);

  if (loading) {
    return (
      <div style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "50vh"
      }}>
        <div style={{
          display: "inline-block",
          width: "50px",
          height: "50px",
          border: "3px solid #f3f3f3",
          borderTop: "3px solid #ff9800",
          borderRadius: "50%",
          animation: "spin 1s linear infinite"
        }}></div>
        <p style={{marginLeft: "1rem"}}>Loading movie details...</p>
      </div>
    );
  }

  if (error) {
    return (
      <div style={{
        textAlign: "center",
        padding: "2rem",
        maxWidth: "600px",
        margin: "0 auto"
      }}>
        <h2>Error</h2>
        <p>{error}</p>
        <Link to="/" style={{
          background: "#ff9800",
          color: "#fff",
          padding: "0.7rem 2rem",
          borderRadius: "6px",
          textDecoration: "none",
          display: "inline-block",
          marginTop: "1rem"
        }}>
          Back to Home
        </Link>
      </div>
    );
  }

  if (!movie) return null;

  return (
    <div style={{
      maxWidth: "1200px",
      margin: "0 auto",
      padding: "2rem"
    }}>
      <div style={{
        display: "flex",
        gap: "2rem",
        flexWrap: "wrap",
        alignItems: "flex-start"
      }}>
        <img
          src={movie.Poster !== "N/A" ? movie.Poster : "https://via.placeholder.com/300x450/666/fff?text=No+Image"}
          alt={movie.Title}
          style={{
            width: "300px",
            height: "450px",
            objectFit: "cover",
            borderRadius: "12px",
            background: "#444"
          }}
        />
        <div style={{flex: 1, minWidth: "300px"}}>
          <h1 style={{marginTop: 0}}>{movie.Title} ({movie.Year})</h1>
          <p><strong>Genre:</strong> {movie.Genre}</p>
          <p><strong>Director:</strong> {movie.Director}</p>
          <p><strong>Cast:</strong> {movie.Actors}</p>
          <p><strong>Plot:</strong> {movie.Plot}</p>
          <p><strong>Runtime:</strong> {movie.Runtime}</p>
          <p><strong>Rating:</strong> {movie.imdbRating}/10</p>
          <p><strong>Released:</strong> {movie.Released}</p>
          
          <Link to={`/book/${id}`}>
            <button style={{
              padding: "1rem 2rem",
              background: "#ff9800",
              color: "#fff",
              border: "none",
              borderRadius: "6px",
              fontSize: "1.1rem",
              cursor: "pointer",
              marginTop: "1rem"
            }}>
              Book Now
            </button>
          </Link>
        </div>
      </div>
    </div>
  );
}

export default MoviePage;
